  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143930 includes discrete
  sample and profile data collected from AURORA AUSTRALIS in the Indian Ocean and
  Southern Oceans (> 60 degrees South) from 2003-01-03 to 2003-03-17. These data include
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, Potential temperature (theta), SALINITY,
  WATER TEMPERATURE, nitrate + nitrite content (concentration), phosphate and silicate.
  The instruments used to collect these data include CTD and bottle.nnThese data were
  collected by John A. Church and Stephen R. Rintoul of Commonwealth Scientific and
  Industrial Research Organization as part of the CLIVAR I08S_2003 data set. CDIAC
  associated the following cruise ID(s) with this data set: CLIVAR I08S_2003nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
